import React from "react";
import styled from "styled-components";
import "../styles/post.css";

const Custompost = styled.header`
  font-family: "Open Sans Condensed", sans-serif;
  letter-spacing: 0.5px;
`;



function Post() {
 return(
     <Custompost>
    <div className="post">
       <p className="posts-title">Top Announcements</p>
       <div className="popular-categories">
        <div className="categories-window">
          <p className="categories-title">Home Cleaning</p>
        </div>
        <div className="categories-window">
          <img className="categories-img" src={hairdresser}></img>
          <p className="categories-title">Hairdresser</p>
        </div>
        <div className="categories-window">
          <img className="categories-img" src={nail}></img>
          <p className="categories-title">Nail Master</p>
        </div>
        <div className="categories-window">
          <img className="categories-img" src={driving}></img>
          <p className="categories-title">Driving Lessons</p>
        </div>
        </div>
     </div>
     </Custompost>
 )
}

export default Post;
